	void/*para multiplicar polinomios*/ PEI::conv(double *pol1,int dim1, double *pol2, int dim2, double *pol_fin){//dim pol_fin 
		//todo:trocar por ciclos for
		for (int e=(dim1+dim2);e>=0;e--)pol_fin[e]=0.0;
			while(dim1>=0){
				for(int i=dim2;i>=0;i--){
				pol_fin[(dim1+i)]=pol_fin[(dim1+i)]+pol1[dim1]*pol2[i];
				};			
			dim1--;
			};
	};
	void PEI::adic(double *pol1,  int dim1, double *pol2,  int dim2){//dim2<dim1vv
		for( int i=0;i<=dim2;++i)pol1[i]=pol1[i]+pol2[i];
	};
	void PEI::inv(double *pol_fin, unsigned int dimo){
		for( int i=0;i<=(dimo);++i)pol_fin[i]=-pol_fin[i];
	};
